INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'food-supplies', 'Pet Food Warehouse', 'We are more of a department store for your pet than just a pet store. You will find more than 55 different brands of dog/cat foods and the most wonderful variety of treats. We also have a huge toy selection for dogs, cats, birds and small animals. In our tropical fish room you&apos;ll find more than 60 tanks of fish as well as a full line of aquariums. Please come visit us and explore the vast variety of wonderful products we have to offer! And, if you can&apos;t find what you&apos;re looking for, we&apos;re HAPPY to place special orders!','1830 61st Ave N  Saint Petersburg, FL 33714', 'https://www.petfoodstpete.com/pet-food-warehouse/','(727) 521-6191', '2021-10-01', '2021-10-01', 27.827558, -82.658345);
INSERT INTO "Listings" ("IsActive", "ListingType", "Name", "Description", "Address", "Website", "PhoneNumber", "CreatedDate", "UpdatedDate", "Latitude", "Longitude") VALUES ('True', 'dining-drinks', 'Dog Bar', 'The Dog Bar is a combination of a private off leash dog park and a full service sports bar. Watch your dog play while you enjoy your favorite beverage! Located in the Grand Central District of St. Pete, this unique spot offers a hybrid between a private dog park and a full liquor, beer, and wine bar. Our unique concept is all about the dogs and we require our doggie patrons to have a membership, this helps us ensure that all of our pups are healthy and nonaggressive.','2300 Central Avenue, Saint Petersburg, FL 33712', 'https://www.dogbarstpete.com','(727) 317-4968', '2021-10-04', '2021-10-04', 27.770697, -82.664725);